import React from 'react';
import PostCard from '../PostCard/PostCard';

// import './PostCardList.css';

const PostCardList = ({cards}) => {
	const allCards = cards.map((card,i) => {
		return(
			<PostCard 
			plateName = {card[i].title}
			price = {card[i].id}
			/>
		)
	})


	return(
		<div>

			{allCards}

		</div>

	)

}
export default PostCardList;
